import React, { Component } from 'react'

import styled from 'styled-components'

const LoginHeader = styled.h4`
  text-align: right;
  margin-right: 20px;
`

class LoginUser extends Component {
  render () {
    return (
      <div>
        <LoginHeader>Login</LoginHeader>
      </div>
    )
  }
}

export default LoginUser
